import Footer from "./Footer";
import { BrowserRouter , Switch, Route } from "react-router-dom";

export default function Body(){
    return(
        <>
            <Headers/>
            <BrowserRouter>
                <Switch>
                    <Route exact path="/" />
                </Switch>
            </BrowserRouter>
            <Footer/>
        </>
    )
}
